import React from 'react';
import ChatbotComponent from './Component/ChatbotComponent';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Chatbot Demo</h1>
      </header>
      <ChatbotComponent />
    </div>
  );
}

export default App;
